  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:50.325553\",\n\t\"name\": \"progress-report-no-1-prairie-grouse-population-and-habitat-studies\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Progress report on the wildlife management
  of prairie grouse. A census of sharp-tailed grouse dancing grounds was again made
  to determine the population for the study proposal first initiated in 1954. Field
  work indicated that 22 grounds were active in 1967, 2 more than were used in 1966.
  The average number of males per ground was 19.4, the highest since the record of
  20.4 for 1958 and well above the 12 year average of 15.9. The total of 427 males
  represented an increase of 24.1 over the 344 males the year before. Using this as
  a basis, the breading population was estimated at 840 birds. Grouse studies at Des
  Lacs will be directed toward management for sharp-tailed grouse since this area
  is on the northern fringe of the original pinnated range and pinnated grouse are
  probably extinct locally. Sharptails are more abundant and seem to be more adaptable
  to changing habitat conditions. The primary purpose of this study is to obtain information
  which will enable the refuge to maintain good grouse habitat and insure vigorous
  grouse populations for the future. This is part of a balanced upland management
  program.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
